    let {id}=useParams();
    const [doctors,setDoctors]=useState([
        {
            doctorId:1,
            doctorName:"Sachin",
            specialist:"Ent",
            hopitalId:2,
        },
        {
            doctorId:2,
            doctorName:"Vinoth",
            specialist:"MD",
            hopitalId:1,
        },
        {
            doctorId:3,
            doctorName:"Mattu",
            specialist:"Heart",
            hopitalId:3,
        }
    ,
        {
            doctorId: 4,
            doctorName: "Vasan",
            specialist: "Kidney",
            hopitalId: 4,
        }
    ]);
    // useEffect(()=>{

    // },[])
  return (
    <>
        <PatientNavBar/>
        <div>{
              doctors.filter(doctor=>doctor.hopitalId==id).map((doc)=>
          <table>
            <thead>
                <th>doctorId</th>
                <th>
                    doctorName
                </th>
                <th>specialist</th>
            </thead>
            <tbody>
                <tr>
                              <td>{doc.doctorId}
                              <td>{doc.doctorId}
                              </td>
                        </td>
                        </tr>
                          <tr></tr>
            </tbody>
          </table>
              )
            }
        </div>



    </>
  )
}

export default PatientAppointment
